-- 3. ccam_api_info
INSERT INTO `ccam_api_info` (`api_id`,`tag_id`,`collection_id`,`api_summary`,`operation_id`,`api_description`,`api_method`,`api_path`,`deprecated`,`create_user`,`create_date`,`update_user`,`update_date`,`deleted`,`api_remark`) VALUES ('193','61','14','just4Test','just4TestUsingGET','','GET','/AddressServiceRest/just4Test','0','li.y.171','2025-04-07 14:58:40','(null)','2025-04-07 14:58:40','0','(null)'),('190','61','14','添加地址','addAddressUsingPOST','新增主地址或者次要地址 注：每一个地址类型的第一条地址必须是主地址，且同一类型的主地址只能有一条 场景1、没有地址，首次添加必须是主地址 场景2、有主地址，可以新增其他主地址或者次要地址','POST','/AddressServiceRest/addAddress','0','li.y.171','2025-04-07 14:58:40','(null)','2025-04-07 14:58:40','0','(null)'),('191','61','14','checkSuccess','checkSuccessUsingPOST','','POST','/AddressServiceRest/checkSuccess','0','li.y.171','2025-04-07 14:58:40','(null)','2025-04-07 14:58:40','0','(null)'),('192','61','14','删除地址信息','deleteAddressUsingPOST','删除地址信息','POST','/AddressServiceRest/deleteAddress','0','li.y.171','2025-04-07 14:58:40','(null)','2025-04-07 14:58:40','0','(null)'),('194','61','14','just4TestPost','just4TestPostUsingPOST','','POST','/AddressServiceRest/just4TestPost','0','li.y.171','2025-04-07 14:58:40','(null)','2025-04-07 14:58:40','0','(null)'),('195','61','14','修改地址信息','modifyAddressUsingPOST','修改地址信息 注：主地址不能更新为次要地址，如需变更主地址只需传递要改为主地址的地址即可，其他同一类型的地址都会变为次要地址 每一个地址类型的第一条地址必须是主地址，且同一类型的主地址只能有一条 场景1、通过租户ID和会员Id保存地址信息，如果是主地址则保存，如果是次要地址且地址信息和主地址不一致则新增 场景2、通过租户ID，会员ID和地址Code更新地址 场景3、通过租户ID，会员ID和地址ID更新地址','POST','/AddressServiceRest/modifyAddress','0','li.y.171','2025-04-07 14:58:40','(null)','2025-04-07 14:58:40','0','(null)'),('196','61','14','查询地址信息','queryAddressUsingPOST','查询地址信息 场景1、通过租户ID和会员Id查询用户所有地址信息集合 场景2、通过租户ID，会员ID，地址Code查询指定地址信息集合(正常情况只有一条） 场景3、通过租户ID，会员ID，地址类型查询指定地址类型的地址信息集合','POST','/AddressServiceRest/queryAddress','0','li.y.171','2025-04-07 14:58:40','(null)','2025-04-07 14:58:40','0','(null)'),('197','61','14','updateRedisSequence','updateRedisSequenceUsingPOST','','POST','/AddressServiceRest/updateRedisSequence','0','li.y.171','2025-04-07 14:58:40','(null)','2025-04-07 14:58:40','0','(null)');

